  - id: 60
    name: Players - for Status, Source, Rank
    description: Players having a specific status or method between certain dates
      (for example "complete") that did not have a status or method at any time in
      the past (for example, "opt-out")
    sql: "select distinct m.id master_id, msid, UPPER(LEFT(pi.first_name,1)) || LOWER(SUBSTRING(pi.first_name,2))
      as first,\r\nUPPER(LEFT(pi.last_name,1)) || LOWER(SUBSTRING(pi.last_name,2))
      as last,\r\npi.rank, pi.source\r\nFROM player_infos pi \r\n:filter_previous\r\ninner
      join masters m on m.id = pi.master_id\r\nWHERE \r\n((:source) IS NULL or pi.source
      in (:source) )\r\nAND ((:player_has_rank) is null or pi.rank in (:player_has_rank))\r\nAND
      (\r\n  (:with_status) is null AND (:with_method) is null\r\n  OR exists\r\n
      \ (select th.master_id from tracker_history th where\r\n     th.master_id =
      pi.master_id and \r\n     (sub_process_id in (:with_status) or protocol_event_id
      in (:with_method) )\r\n     and (:from_date is null or  event_date >= :from_date)
      \r\n     and (:to_date is null or event_date <= :to_date)\r\n  )\r\n)\r\nAND
      (\r\n  (:without_status) is null AND (:without_method) is null\r\n  OR\r\n  not
      exists\r\n  (select th.master_id from tracker_history th where\r\n     th.master_id
      = pi.master_id and \r\n     (sub_process_id in (:without_status) or protocol_event_id
