  - id: 67
    name: Study Completers Over Time Chart
    description: ''
    sql: "create temp table temp_q1\r\nas\r\nselect event_date::date event_date, count(*)
      completions from tracker_history th \r\nwhere\r\nth.sub_process_id = 39 \r\ngroup
      by event_date::date\r\n;\r\n\r\ncreate temp table temp_law\r\nas\r\nselect event_date::date
      event_date, count(*) completions from tracker_history th \r\nwhere\r\nth.sub_process_id
      = 72 \r\ngroup by event_date::date\r\n;\r\n\r\ncreate temp table temp_ts\r\nas\r\nselect
      event_date::date event_date, count(*) completions from tracker_history th \r\nwhere\r\nth.sub_process_id
      = 65\r\ngroup by event_date::date\r\n;\r\n\r\n------------------------------\r\ncreate
      temp table temp_bhs\r\nas\r\nselect event_date::date event_date, count(*) completions
      from tracker_history th \r\nwhere\r\nth.sub_process_id = 75\r\ngroup by event_date::date\r\n;\r\n\r\ncreate
      temp table temp_ipa\r\nas\r\nselect event_date::date event_date, count(*) completions
      from tracker_history th \r\nwhere\r\nth.sub_process_id = 95\r\ngroup by event_date::date\r\n;\r\n\r\ncreate
      temp table temp_q2\r\nas\r\nselect event_date::date event_date, count(*) completions
      from tracker_history th \r\nwhere\r\nth.sub_process_id = 108\r\ngroup by event_date::date\r\n;\r\n\r\ncreate
      temp table temp_s1\r\nas\r\nselect event_date::date event_date, count(*) completions
      from tracker_history th \r\nwhere\r\nth.sub_process_id = 113\r\ngroup by event_date::date\r\n;\r\n\r\ncreate
      temp table temp_pn\r\nas\r\nselect event_date::date event_date, count(*) completions
      from tracker_history th \r\nwhere\r\nth.sub_process_id = 91\r\ngroup by event_date::date\r\n;\r\n\r\n----------------------------\r\n\r\n\r\ncreate
      temp table data as (\r\n  \r\nselect '2014-09-01' \"event date\",\r\n  0 q1,\r\n
      \ 0 q2,\r\n  0 bhs,\r\n  0 persnet,\r\n  0 ipa,\r\n  0 \"sleep p1\",\r\n  0
      \"law and ethics\",\r\n  0 \"team study\"\r\n\r\n UNION\r\n  \r\nselect \r\ncoalesce(\r\n
      \ temp_q1.event_date, \r\n  temp_law.event_date, \r\n  temp_ts.event_date,\r\n
      \ temp_pn.event_date,\r\n  temp_ipa.event_date,\r\n  temp_bhs.event_date,\r\n
      \ temp_q2.event_date,\r\n  temp_s1.event_date\r\n) \"event date\", \r\ncoalesce(temp_q1.completions,
      0) q1,\r\ncoalesce(temp_q2.completions, 0) q2,\r\ncoalesce(temp_ipa.completions,
      0) ipa,  \r\ncoalesce(temp_pn.completions, 0) pn,\r\ncoalesce(temp_bhs.completions,
      0) bhs, \r\ncoalesce(temp_s1.completions, 0) s1,  \r\ncoalesce(temp_law.completions,
      0) \"law and ethics\",\r\ncoalesce(temp_ts.completions, 0) \"team study\"\r\nfrom
      temp_q1\r\nfull outer join temp_law\r\non temp_q1.event_date = temp_law.event_date\r\nfull
      outer join temp_ts\r\non temp_q1.event_date = temp_ts.event_date\r\nfull outer
      join temp_bhs\r\non temp_q1.event_date = temp_bhs.event_date\r\nfull outer join
      temp_ipa\r\non temp_q1.event_date = temp_ipa.event_date\r\nfull outer join temp_s1\r\non
      temp_q1.event_date = temp_s1.event_date\r\nfull outer join temp_q2\r\non temp_q1.event_date
      = temp_q2.event_date\r\nfull outer join temp_pn\r\non temp_q1.event_date = temp_pn.event_date\r\n\r\n
      \ \r\n  order by \"event date\"\r\n)\r\n;\r\n\r\nselect\r\n  \"event date\",\r\n
      \ sum(q1) over(order by \"event date\" asc rows between unbounded preceding
      and current row) \"q1\", \r\n  \r\n  sum(q2) over(order by \"event date\" asc
      rows between unbounded preceding and current row) \"q2\", \r\n  sum(bhs) over(order
      by \"event date\" asc rows between unbounded preceding and current row) \"bhs\",
      \r\n  sum(persnet) over(order by \"event date\" asc rows between unbounded preceding
      and current row) \"persnet\", \r\n  sum(ipa) over(order by \"event date\" asc
      rows between unbounded preceding and current row) \"ipa\", \r\n  sum(\"sleep
      p1\") over(order by \"event date\" asc rows between unbounded preceding and
      current row) \"sleep p1\", \r\n  \r\n  sum(\"law and ethics\") over(order by
      \"event date\" asc rows between unbounded preceding and current row) \"law and
      ethics\", \r\n  sum(\"team study\") over(order by \"event date\" asc rows between
      unbounded preceding and current row) \"team study\"\r\n  \r\nfrom data;"
