    sql: "select \r\n  event_date,\r\n  --p.name protocol, \r\n--  p.name || ': '
      ||\r\n--  coalesce(pe.name, sp.name) \"event\", \r\n  count(*) \"number\"\r\nfrom
      tracker_history th \r\nleft join protocol_events pe\r\n  on pe.id = th.protocol_event_id\r\ninner
      join sub_processes sp\r\n  on sp.id = th.sub_process_id\r\ninner join protocols
      p\r\n  on p.id = th.protocol_id\r\n\r\nwhere th.protocol_id in (2,3,5,6,7,8,9,10,11,12)
      \r\n\r\ngroup by \r\n  event_date \r\n--  protocol, \r\n--  event\r\n\r\norder
